import React from "react";
import "./TopBar.css";
import { FaUserCircle } from "react-icons/fa";

export default function TopBar() {
  return (
    <div className="topbar">

      {/* SIGA E SEJA SEGUIDO */}
      <div className="follow-box">
        <img
          src="/assets/icons/painel-status/topbar/Sigaesejaseguido.png"
          className="follow-title-img"
          alt="Siga e seja seguido"
        />

        <div className="follow-row">
          <img src="/assets/icons/painel-status/topbar/SemNovosCanais.png" className="follow-mini" />
          <img src="/assets/icons/painel-status/topbar/AguardarButton.png" className="follow-mini" />
        </div>
      </div>

      {/* Separador */}
      <img src="/assets/icons/painel-status/topbar/DiamanteDourado.png" className="separator" />

      {/* CONECTAR CANAIS */}
      <div className="topbar-item">
        <img src="/assets/icons/painel-status/topbar/TwitchNeonLogo.png" className="tb-mini" />
        <img src="/assets/icons/painel-status/topbar/KickMiniLogo.png" className="tb-mini" />
        <img src="/assets/icons/painel-status/topbar/YouTubeMiniLogo.png" className="tb-mini" />
      </div>

      <img src="/assets/icons/painel-status/topbar/DiamanteDourado.png" className="separator" />

      {/* ATUALIZAÇÕES */}
      <div className="topbar-item">
        <img src="/assets/icons/painel-status/topbar/Download.png" className="tb-icon" />
      </div>

      <img src="/assets/icons/painel-status/topbar/DiamanteDourado.png" className="separator" />

      {/* TUTORIAL */}
      <div className="topbar-item">
        <img src="/assets/icons/painel-status/topbar/TutorialVermelho.png" className="tutorial-img" />
      </div>

      <img src="/assets/icons/painel-status/topbar/DiamanteDourado.png" className="separator" />

      {/* AJUDA */}
      <div className="topbar-item">
        <img src="/assets/icons/painel-status/topbar/AjudaAmarelo.png" className="ajuda-img" />
      </div>

      <img src="/assets/icons/painel-status/topbar/DiamanteDourado.png" className="separator" />

      {/* USUÁRIO */}
      <div className="user-area">
        <FaUserCircle className="tb-user" />
      </div>
    </div>
  );
}
